export class MultiProgressBarReporter {
    constructor() {
        this.running = false;
        this.current = {
            optProgressBar: null,
        };
    }
    start(name, optProgressBar) {
        this.current = {
            optProgressBar,
        };
        this.running = true;
    }
    update(event) { }
    stop(name) {
        this.running = false;
        return name;
    }
    async completed() {
        this.running = false;
    }
}
